<template>
  <header class="emfe-header-active">
    <div class="emfe-header-active-main">
      <div v-if="src" class="emfe-header-active-eye">
        <img :src="src" class="emfe-header-active-eye-img">
      </div>
      <div class="emfe-header-active-info">
        <!-- <span class="emfe-header-active-account">你好，
          <span v-if="loginFlg">{{ user }}</span>
          <emfe-link class="emfe-header-active-login" :routers="{}" @click="login" v-if="!loginFlg">请登录</emfe-link>
        </span> -->
        <emfe-link className="emfe-header-active" :routers="{}" @click="myRegis">我的报名</emfe-link>
        <emfe-tooltip style="position:relative;" :styles="{'left': '-28px','top': '50px', 'position': 'absolute'}" theme="light" placement="bottom">
          <emfe-link slot="render" className="emfe-header-active" :routers="{}" @click="organizer">主办APP</emfe-link>
          <div slot="tip" class="emfe-header-active-erweima">
            <img class="emfe-header-active-erweima-img" :src="erweimaSrc" alt="">
            <p class="emfe-header-active-erweima-text">扫一扫，下载App</p>
          </div>
        </emfe-tooltip>
        <emfe-button className="emfe-header-active" theme="primary" type="fabu" @click="release">免费发活动</emfe-button>
        <emfe-link class="emfe-header-active-logout" :routers="{}" @click="logout" v-if="loginFlg">退出</emfe-link>
      </div>
    </div>
  </header>
</template>
<script>
export default {
  name: 'EmfeHeaderActive',
  data() {
    return {
      src: '',
      erweimaSrc: '',
    };
  },
  props: {
    user: {
      type: String,
    },
    loginFlg: {
      type: Boolean,
      required: true,
    },
    imgLogo: {
      type: String,
    },
  },
  created() {
    this.src = this.imgLogo;
    this.erweimaSrc = 'data:image/png;base64,';
  },
  watch: {
    loginFlg(val, oldVal) {
      if (val !== oldVal) {
        this.loginFlg = val;
      }
    },
  },
  methods: {
    // 退出
    logout() {
      this.$emit('logout');
    },
    // 我的报名
    myRegis() {
      this.$emit('myRegis');
    },
    //发布
    release() {
      this.$emit('release');
    },
    // 主办方
    organizer() {
      this.$emit('organizer');
    },
    // 登录
    login() {
      this.$emit('login');
    },
  },
};
</script>


export default EmfeHeaderActive;
